import React from "react";
import custom from "./images/custom.jpg";

const CloneHeader = () => {
    return (<>
        <header>
        <div>
            <img src = {custom} alt = "logo" width = "80" height = "70"/>
            </div>
        </header>
    </>);
}

export default CloneHeader;
